import React from "react"
import { FaBusAlt } from "react-icons/fa";

class DetailServices extends React.Component {
    constructor() {
        super()
        this.state = {
            loading: true,
            services: []
        }

    }

    componentDidMount(props) {
        console.log("DetailServices Mounted", this.props.services)
        this.setState({
            loading:false,
            services: this.props.services
        })

    }

   render() {
     if (this.state.loading === false) {
               var serviceIcon;
    switch (this.props.service[0].serviceName) {
        case "Busanreise":
            serviceIcon = <FaBusAlt />;
            break;
        case "Hotel":
            serviceIcon = "Fuck";
            break;
    }

     }  
    console.log("DetailServicesState", this.state)

    var serviceICON = this.state.services.map(service => (
        <button className="button is-outlined is-primary">{this.serviceIcon}{service.serviceName}</button>
    ))

    return (
        <div>
        <h1>DetailsServices</h1> 
        {serviceIcon}<br />
        </div>   )
   }
}


export default DetailServices
